MongoDB: How to speed up my data reorganisation query/operation?<p>I'm trying to analyse some data and I thought my queries would be faster ultimately by storing a relationship between my collections instead. So I wrote something to do the data normalisation, which is as follows:</p>
<pre><code>var count = 0;
db.Interest.find({'PersonID':{$exists: false}, 'Data.DateOfBirth': {$ne: null}})
.toArray()
    .forEach(function (x) {
    if (null != x.Data.DateOfBirth) {
        var peep = { 'Name': x.Data.Name, 'BirthMonth' :x.Data.DateOfBirth.Month, 'BirthYear' :x.Data.DateOfBirth.Year};
        var person = db.People.findOne(peep);
        if (null == person) {
            peep._id = db.People.insertOne(peep).insertedId;
            //print(peep._id);
        }

        db.Interest.updateOne({ '_id': x._id }, {$set: { 'PersonID':peep._id }})

        ++count;
        if ((count % 1000) == 0) {
            print(count + ' updated');
        }
    }
})
</code></pre>
<p>This script is just passed to mongo.exe.</p>
<p>Basically, I attempt to find an existing person, if they don't exist create them. In either case, link the originating record with the individual person.</p>
<p>However this is very slow! There's about 10 million documents and at the current rate it will take about 5 days to complete.</p>
<p>Can I speed this up simply? I know I can multithread it to cut it down, but have I missed something?</p>

